import React from 'react';
import 'boxicons';

const TextEditor = () => {
    return (
        <div className='containder w-1/2 h-1/2 bg-slate-50 rounded-md p-10'>
            <div className='flex flex-row items-center justify-start'>
                <box-icon name='bold' size='2rem'></box-icon>
                <box-icon name='underline'></box-icon>
                <box-icon name='italic'></box-icon>
                <box-icon name='font-size'></box-icon>
                <box-icon name='font-family'></box-icon>
                <box-icon name='list-ul'></box-icon>
                <box-icon name='left-indent' ></box-icon>
                <box-icon name='right-indent' ></box-icon>
                <box-icon name='align-left' ></box-icon>
                <box-icon name='align-middle' ></box-icon>
                <box-icon name='align-right' ></box-icon>
            </div>
        </div>
    );
};

export default TextEditor;
